import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Added import for Routes and Route
import Navbar from './components/Navbar/navbar';
import Footer from './components/footer/footer';
import Home from './pages/home/home';
import Services from './pages/service/service'; // Changed 'Service' to 'Services' for consistency
function App() {
  return (
    <div className="App">
      <Navbar />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/services" element={<Services />} /> {/* Changed 'Services' component name */}
      </Routes>
      <Footer/>
    </div>
  );
}

export default App;
